translation:
وبالانتقال إلى الأمام، سيمنح المشتركون مبلغا مقطوعا شهريا من روبوكس بدلا من تلقيه بزيادات يومية. اليوم، نحن نودع {robuxAmount} Robux في حسابك للتعويض عن المبلغ المتبقي الذي كنت ستكسبه هذا الشهر.
{newLine}{newLine}
تحقق من صندوق البريد الخاص بك للحصول على مزيد من التفاصيل.
